import { Component } from '@angular/core';

@Component({
  selector: 'app-no-found-page',
  templateUrl: './no-found-page.component.html',
  styleUrls: ['./no-found-page.component.css']
})
export class NoFoundPageComponent {

}

<section id="wrapper" class="error-page">
    <div class="error-box">
        <div class="error-body text-center">
            <h1>404</h1>
            <h3 class="text-uppercase">Pagina no encontarda !</h3>
            <a href="index.html" class="btn btn-info btn-rounded waves-effect waves-light m-b-40">Si crees que es un error Habla con un administrador</a>
            <br>
        </div>
        <footer class="footer text-center">© 2023 yavirac matutino a cuarto.</footer>
    </div>
</section>
